import { Paper } from '@mui/material';
import './home.scss';

export const Home = () => {
    return (
        <div className='content home'>
            <Paper elevation={24}>
                <h3>Welcome to the Resume Management Resource React-App</h3>
                <br />
                <br />
                <br />
                <span>
                    This is a Resume Management Resouce builder, built in
                    React18 for the frontend and Asp.Net as the backend. This is
                    a simple CRUD operation of grids to hold on to job sources
                    and pdf files for the respected roles. Try it out!
                </span>
            </Paper>
        </div>
    );
};

export default Home;
